        <div id="search-container">
            <input id="search-input" type="text" value="" placeholder="Search a place on the map..."/>
            <div class="btn" onclick="search();">SEARCH</div>
            <div id="logs"></div>
            <div id="track-btn" class="btn" onclick="toggleTrackPosition()">TRACK POSITION</div>
        </div>

        <script type="module">
            import GeoMapping from '../dist/geomapping.es6.min.js';

            window.svg = new svgLayerZoom({
                containerSelector: '#container',
                svgSelector: '#map-france',
                svgLayersSelector: 'g#map-regions g',
                zoomMax: 30,
                animDuration: .75,
                classActive: 'country-on',
                changeLayerWhenZoomed: true,
                autoZoom: true,
                autoUnzoom: true,
            });
            svg.on(svgLayerZoom.EVENTS.BEFORE_ZOOM, function(data){
                console.log(svgLayerZoom.EVENTS.BEFORE_ZOOM, data);
            });
            svg.on(svgLayerZoom.EVENTS.BEFORE_UNZOOM, function(data){
                console.log(svgLayerZoom.EVENTS.BEFORE_UNZOOM, data);
            });

            window.GeoMapping = GeoMapping;
            window.geoMap = new GeoMapping(geomapConfig);
            geoMap.on(GeoMapping.EVENTS.READY, function(){
                updatePoints();
                svg.imgMap.zoomable.zoomable.apply();
            });
            geoMap.on(GeoMapping.EVENTS.ADD, function(_point){
                addMarker(_point);
                svg.imgMap.zoomable.zoomable.apply();
            });
            geoMap.on(GeoMapping.EVENTS.REMOVE, function(_point){
                // DO SOME STUFF HERE
            });
            geoMap.on(GeoMapping.EVENTS.UPDATE_POSITION, function(data){
                addMarker(data, true);
                svg.imgMap.zoomable.zoomable.apply();
            });
            geoMap.on(GeoMapping.EVENTS.STOP_POSITION, function(){
                var myPositionElt = document.getElementById("track-position");
                if(myPositionElt){
                    $(myPositionElt).remove();
                    gpsElt = undefined;
                }
            });
            geoMap.on(GeoMapping.EVENTS.READY, function(){
                $('#container img:not(.hotspot), #container svg').on('click', function(e){
                    var coords = geoMap.getLatLngOnMap(e.offsetX, e.offsetY);
                    if(coords){
                        $('#logs').html('Coords of point clicked => lat: ' + coords.lat + ', lng: ' + coords.lng + ', x: ' + e.offsetX + ', y: ' + e.offsetY);
                    }
                });
            });
        </script>
